pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";

contract CRC141 is ERC721Enumerable {
    uint256 public tokenCount = 0;
    string public _name;
    address payable cfont;
    mapping(uint256 => Token) public tokens;
    uint256 fee = 0.1 ether;
    address _owner;

    struct Token {
        uint256 id;
        string hash;
        string title;
        string genre;
        uint256 created;
        string album;
        string coverURI;
        address creator;
    }

    event TokenUploaded(
        uint256 id,
        string hash,
        string title,
        string genre,
        uint256 created,
        string album,
        string coverURI,
        address creator
    );

    constructor(address payable _cfont) ERC721("CRC141", "CryptoFont Music") {
        _owner = msg.sender;
        cfont = _cfont;
    }

    function setFee(uint256 amount) public {
        require(address(msg.sender) == _owner);
        fee = amount;
    }

    function upload(
        string memory _hash,
        string memory _genre,
        string memory _album,
        string memory _title,
        string memory coverURI
    ) public payable {
        // Make sure the video hash exists
        require(bytes(_hash).length > 0);
        // Make sure video title exists
        require(bytes(_title).length > 0);
        // Make sure uploader address exists
        require(msg.sender != address(0));

        require(msg.value >= fee);

        // Add video to the contract
        tokens[tokenCount] = Token(
            tokenCount,
            _hash,
            _title,
            _genre,
            block.timestamp,
            _album,
            coverURI,
            msg.sender
        );
        _safeMint(msg.sender, tokenCount);
        // Trigger an event
        tokenCount++;
        require(cfont.send(fee));
        emit TokenUploaded(
            tokenCount,
            _hash,
            _title,
            _genre,
            block.timestamp,
            _album,
            coverURI,
            msg.sender
        );
    }

    function setCover(uint256 tokenId, string memory _URI) public {
        require(tokens[tokenId].creator == msg.sender);
        require(bytes(tokens[tokenId].coverURI).length == 0);
        tokens[tokenId].coverURI = _URI;
    }
}
